  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet is a compilation of Well
  header information compiled by the Indiana Geological Survey, published as a Web
  feature service for the National Geothermal Data System. The document contains 9
  worksheets, including information about the template, resource provider information,
  the data, and a worksheet with vocabularies for use in populating the spreadsheet
  (data valid terms). Data from 405 wells are included. Fields in the template include
  well name and API number, driller total depth, notes, related resources, and information
  sources, among others.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
